import React from "react";

const Posts = ({ posts }) => {
  return (
    <section className="posts-section">
      {posts &&
        posts.map((post) => (
          <div class="card" style="width: 18rem;">
            <img
              src="http://source.unsplash.com/random"
              class="card-img-top"
              alt={"Image for: " + post.title}
            />
            <div class="card-body">
              <h5 class="card-title">{post.title.substr(0, 50)}</h5>
              <p class="card-text">{post.exerpt.substr(0, 70)}</p>
              <a href="#" class="btn btn-primary">
                Go somewhere
              </a>
            </div>
          </div>
        ))}
    </section>
  );
};

export default Posts;
